import React from 'react';
import './home.css';

function Home() {

  return (
      <div className={'home'}>
          <img className={'logo'} src={'https://mymaes.org/wp-content/uploads/2017/04/maes-logo-2012-with-tagline.jpg'}/>
          <h1>Welcome to the MIT Chapter of MAES!</h1>
          <p>MAES at MIT is a tight-knit community that focuses on the professional development of its individual members, offering them resources and opportunities for success. Becoming a member is simple: Join us every other Friday in the Latino Cultural Center at 5:45pm. Check out our Facebook Page for the details.</p>
          <p>about us</p>
          <p>facebook</p>

          <h1>Professional Development </h1>
          <p>MIT MAES is able to foster the professional development of its members through:

              Resume workshops
              Exposure to companies through a resume book
              Intimate networking opportunities
              If you are a company that is interested in developing a relationship with the MIT Chapter of MAES, please email us at maes-request@mit.edu.</p>
          <h1>Community Outreach</h1>
          <p>MIT MAES strives to have a strong impact in the community through:

              Science Extravaganza
              Weekly STEM Workshops
              Volunteering at Local Schools
              We are constantly looking for new ways to expand our community outreach. If you have any suggestions on how to do so or if you would like to partner with us please email maes-request@mit.edu</p>
      </div>
  );
}

export default Home;
